'''编码（初始化种群）'''

def generate_skilllevel_set(product_num):
    s = list(it.product(range(2), repeat=product_num))#生成全排列
    #print(s)
    #将其转化为数组
    skilllevel_set=[[]for i in range(len(s)-1)]
    for i in range(1,len(s)):
        for j in s[i]:
            skilllevel_set[i-1].append(j)
    return skilllevel_set

#定义解码函数
def decoding(pop):#用于解码
    for i in range(len(pop)):
        if i == 0:#将全能工数量取出来
            fullworker_num = pop[0]
            #print(' fullworker_num', fullworker_num)
        else:
            skill_level = pop[1::2]#将奇数位的技能水平取出来
            worker_num = pop[2::2]#将偶数位的工人数量取出来
    skill_list = []
    worker_list = []
    for j in range(len(worker_num)):
        if skill_level[j] != 0 and worker_num[j] != 0:
            skill_list.append(skill_level[j])
            worker_list.append(worker_num[j])
        else:
            continue
    return fullworker_num,skill_list,worker_list

#找出每种产品可选的单元（即每种产品可在哪些单元中生产）
def find_candidate_serus(pop):#寻找产品的备选单元集
    skill_level,worker_num = decoding(pop)[1:]
    candidate_serus = [[] for i in range(len(skilllevel_set[0]))]
    for i in range(len(skilllevel_set[0])):#遍历产品类型
        for j in range(len(skill_level)):
            if skilllevel_set[skill_level[j]-1][i]==1:
                candidate_serus[i].append(j)
    #print('单独函数candidate_serus',candidate_serus)
    return candidate_serus

def is_feasible_solution(pop):#判断是否是可行解，输入个体，输出是否是可行解
    candidate_serus = find_candidate_serus(pop)
    #print('判断是否是可行解中的alternativeseru',alternativeseru)
    feasible_seru = 0
    for j in candidate_serus:
        #print("j",j)
        if len(j) > 0:#产品有单元能够生产
            feasible_seru += 1
        else:
            #print("此产品没有单元可生成")
            return False#不是可行解
            break
    if feasible_seru == len(skilllevel_set[0]):
        return True

def initial_population(popsize,seru_num,worker_num):#个体长度为2*J_max，奇数位的取值范围
    population = []
    while len(population) < popsize:
        pop = []
        for i in range(0,(2*seru_num)+1):#染色体长度
            if i == 0:#存放全能工数量
                pop.append(random.randint(0,worker_num))#需求不确定场景
                #pop.append(0)#需求确定场景
            else:  
                if i%2==1:#如果是奇数位，奇数位表示技能水平，奇数位的取值范围
                    pop.append(random.randint(0,len(skilllevel_set)-1))#需求不确定场景
                    #pop.append(random.randint(0,len(skilllevel_set)))#需求确定场景
                    #pop.append(len(skilllevel_set))
                    #print("奇数位")
                else:
                    pop.append(random.randint(0,worker_num))#偶数位取值范围
                    #print("偶数位")
        #print("pop",pop)
        #判断是否是可行解，保证种群中都是可行解
        if is_feasible_solution(pop) is True:
            population.append(pop)
            #print("是可行解population",population)
    return population

