def compute_trainingcost(pop):#计技能培训成本
    #解码
    fullworker,skill_level,worker_num = decoding(pop) 
    #计算全技能工人的培训成本
    fullworker_trainingcost = fullworker*len(skilllevel_set[0])*unit_trainingcost  #工人数*技能数*单位培训成本
    #print('全技能工的培训成本',fullworker_trainingcost)
    #计算多能工的培训成本
    nonfullworker_trainingcost = 0
    for i in range(len(skill_level)):#遍历每个单元
        trainingcost = sum(skilllevel_set[skill_level[i]-1])*worker_num[i]*unit_trainingcost
        nonfullworker_trainingcost += trainingcost #所有单元的培训成本
    #print('nonfullworker_trainingcost',nonfullworker_trainingcost)    
    training_cost = fullworker_trainingcost + nonfullworker_trainingcost
    #print('training_cost',training_cost)
    return training_cost

