#定义目标函数2：总完工时间，系统中单元中最大完工时间。订单到达时有多少空闲全能工就分配多少全能工，以此提高全能工利用率
def compute_TTPT(pop,order):#注意，必须保证输入的个体是可行解。假设order是按照时间顺序排好序的订单列表
    copy_order = copy.deepcopy(order)
    #total_batchsize = sum(lst[1] for lst in copy_order)
    #print('total_batchsize',total_batchsize)
    #解码
    fullworker,skill_level,worker_num = decoding(pop)
    #print('skill_level',skill_level)
    #print('worker_num',worker_num)
    #定义列表
    fullworker_finishtime = [0 for i in range(fullworker)]#记录分配的全能工信息[全能工索引，完工时间]
    order_assinedtoseru = [[] for i in range(len(skill_level))]#用于记录每个seru分配的订单
    finishtime_list=[[0] for i in range(len(skill_level))]#初始化每个Seru的完成时间为0
    #每种产品的可选分配单元
    candidate_seru_set = find_candidate_serus(pop) #[[产品1的可选单元],[],[]]
    #print('candidate_seru',candidate_seru)
    #订单到达，分配订单到Seru,分配全能工到seru
    while len(copy_order)>0:#订单是按照到达顺序排列的，因此按照订单顺序分配订单
        #print('到达订单',copy_order[0])
        #分解订单信息
        producttype = copy_order[0][0]
        batchsize = copy_order[0][1]
        arrivaltime = copy_order[0][2]
        #步骤1:找出订单可用的Seru，即具备该种产品生产能力且订单到达时空闲的Seru
        #具备该种产品生产能力的seru
        candidate_seru = candidate_seru_set[producttype-1]  #[]可生产该订单的单元
        #print('candidate_seru',candidate_seru)
        #判断订单到达时，这些具备该种产品生产能力的seru是否空闲
        available_seru = []#订单到达时可用的Seru，即当前单元的最后一单完成时间小于等于当前订单的到达时间
        for j in candidate_seru:
            if finishtime_list[j][-1] <= arrivaltime:#seru可用
                available_seru.append(j)
            else:
                continue
        #情况1：到达时只有1个可用的空闲单元，则直接分配到该单元
        if len(available_seru) == 1:
            assignseru = available_seru[0]
            begintime = arrivaltime
        #情况2：到达时有多个可用的空闲单元，则分配到技能水平低的单元,即能处理的产品类型少的单元，保证其他单元可处理更多的产品类型       
        elif len(available_seru) > 1:
            skilllevel_available_seru = []#记录可用单元及其技能水平
            for j in available_seru:#遍历可选的多个空闲单元，计算每个单元的技能水平
                skilllevel_available_seru.append([j,sum(skilllevel_set[skill_level[j]-1])])
            skilllevel_available_seru.sort(key= lambda x: x[1])#按照技能水平从小到大排序
            #print('skilllevel_available_seru',skilllevel_available_seru)
            assignseru = skilllevel_available_seru[0][0]
            begintime = arrivaltime
        #情况3：到达时没有可用的空闲单元，两种情况：（1）个体是不可行解，没有能够生产该种产品的的单元；（2）可行解，但是单元都被占用，则分配到第一个空闲的符合条件的单元
        else:
            #print('没有空闲单元')
            candidate_seru_finishtime = []#[单元编号，最后一个订单结束时间]记录单元及其最后一个订单的结束时间
            for j in candidate_seru:
                candidate_seru_finishtime.append([j,finishtime_list[j][-1]])
            #print('candidate_seru_finishtime',candidate_seru_finishtime)
            candidate_seru_finishtime.sort(key= lambda x: x[1])#按照单元结束时间排序，选择最先结束的单元
            assignseru = candidate_seru_finishtime[0][0]
            begintime = candidate_seru_finishtime[0][1]#开始时间等于上个订单的完成时间
        
        #步骤2:计算准备时间，更新orderInseru
        #情况1：单元内尚未有订单
        if len(order_assinedtoseru[assignseru]) == 0:
            setuptime = 0
            #print('单元内尚未有产品',setuptime)
        #情况2：单元内已经有订单    
        else: 
            if order_assinedtoseru[assignseru][-1][0] == producttype:#判断与前一个订单产品类型是否相同
                setuptime = 0
                #print('与前一产品相同',setupTime)
            else:
                setuptime = setuptime_standard
                #print('与前一产品不同',setupTime)
        order_assinedtoseru[assignseru].append(copy_order[0])   
        #print('order_assinedtoseru',order_assinedtoseru)
        #步骤3：分配全能工，先到达的订单先分配全能工，以最大量分配全能工，计算等待时间和订单完成时间。
        #情况1：单元人数未达到最大值，可分配全能工
        if worker_num[assignseru] < worker_maxnum:#判断单元人数是否超过最大数量，单元人数小于最大数量，则可分配全能工
            available_fullworker=[]
            for w in range(len(fullworker_finishtime)):#遍历全能工完工时间列表,为0表示未分配的全能工
                if fullworker_finishtime[w]  <= begintime:
                    available_fullworker.append(w)
                else:
                    continue
            #确定分配全能工的数量，分配全能工
            fullworker_num = min(len(available_fullworker),(worker_maxnum-worker_num[assignseru]))
            selectworker = available_fullworker[:fullworker_num]
            #print('selectworker',selectworker)
        #情况2：单元人数达到最大值，不可分配全能工
        else:
            fullworker_num = 0
            selectworker = []
        #步骤4：计算订单完工时间
        workers = worker_num[assignseru] + fullworker_num#计算单元内的总人数
        waitingtime = begintime - arrivaltime
        finishtime = compute_order_finishtime(batchsize,workers,arrivaltime,waitingtime,setuptime)
        #更新fullworker_finishtime
        if len(selectworker) > 0:
            for w in selectworker:#遍历被分配的全能工
                fullworker_finishtime[w] = finishtime
            #print('更新后的fullworker_finishtime',fullworker_finishtime) 
        #更新finishtime_list            
        finishtime_list[assignseru].append(finishtime)
        #print('finishtime_list',finishtime_list)
        #更新订单列表，已分配的订单移除
        copy_order.remove(copy_order[0])#将已经分配的订单移除
    #print('finishtime_list',finishtime_list)    
    #步骤5：计算每个单元的完工时间，计算系统最大完工时间TTPT 
    TTPT_in_seru = []
    for i in range(len(finishtime_list)):
        TTPT_in_seru.append(finishtime_list[i][-1])
    TTPT = max(TTPT_in_seru)
    #print('TTPT',TTPT)
    #步骤6：计算响应速度=output/TTPT
    #speed = total_batchsize/TTPT
    #print('speed',speed)
    return TTPT
        
def averageTTPT(pop,OrderList):#一个个体多种场景下的平均服务水平
    copy_orderlist = copy.deepcopy(OrderList)
    TTPT_inscenarios = []
    for i in copy_orderlist:
        TTPT_inthisscenario = compute_TTPT(pop,i)
        TTPT_inscenarios.append(TTPT_inthisscenario)
    #print('*****************不同场景下的speed_inscenarios',speed_inscenarios)
    averageTTPT = np.mean(TTPT_inscenarios)
    average_TTPT= round(averageTTPT,0)
    #print('平均响应速度',speed_inscenarios)
    return average_TTPT

