def nondominatesort(pops_objective): #输入种群目标值列表，输出非支配排序
    #定义列表
    dominatedindividual_num =[0 for i in range(len(pops_objective))]#记录每个个体被支配个体数量，初始化为0
    dominate_set=[[] for i in range(len(pops_objective))]#记录每个个体的支配个体集，初始化为空，存储的是下标
    frontnumber=[0 for i in range(len(pops_objective))]#记录个体所属第几层front,数字代表的层数
    frontset_index=[[]]#记录按pareto层排序的解集,记录的是个体下标
    #生成各个体的支配集和被支配个数，并找出第一层front
    for p in range(len(pops_objective)): 
        #print('#############pops_objective[p]',pops_objective[p])
        for q in range(len(pops_objective)):
            #print('pops_objective[q]',pops_objective[q])
            if (pops_objective[p][0] <= pops_objective[q][0] and pops_objective[p][1] < pops_objective[q][1]) or (pops_objective[p][0] < pops_objective[q][0] and pops_objective[p][1] <= pops_objective[q][1]): #p支配q
                dominate_set[p].append(q)
                #print('dominate_set',dominate_set)
            elif (pops_objective[q][0] <= pops_objective[p][0] and pops_objective[q][1] < pops_objective[p][1]) or (pops_objective[q][0] < pops_objective[p][0] and pops_objective[q][1] <= pops_objective[p][1]):#q支配p
                dominatedindividual_num[p] += 1
                #print('dominatedindividual_num',dominatedindividual_num)
        if (dominatedindividual_num[p] == 0):#不被任何个体支配
            frontnumber[p]=1 #个体p在第1层
            #print('frontnumber',frontnumber)
            frontset_index[0].append(p)
    #print('00dominate_set',dominate_set)
    #print('00dominatedindividual_num',dominatedindividual_num)
    #print('00frontset_index',frontset_index)
    t=1
    while(sum(dominatedindividual_num) != 0):#找到每个非支配曲面的个体
        #print('sum(dominatedindividual_num)',sum(dominatedindividual_num))
        #print('t',t)
        nextfrontset=[] #下一个pareto解集,记录的是下标
        for p in range(len(pops_objective)):
            if dominatedindividual_num[p] == 0 and frontnumber[p] == t:
                for q in dominate_set[p]:
                    dominatedindividual_num[q] -= 1
                    if dominatedindividual_num[q] == 0:
                        nextfrontset.append(q)
                        frontnumber[q] = t + 1
                    #print('nextfrontset',nextfrontset)
                    #print('frontnumber[i]',frontnumber[i])
            else:
                continue
        if len(nextfrontset) != 0:
            frontset_index.append(nextfrontset)#非支配曲面集 
            t = t+1
    #print('非支配排序',frontset_index)
    #print('frontnumber',frontnumber)
    return frontset_index,frontnumber

#输入某一支配层，原种群的目标值列表；输出该层个体的拥挤度距离
def front_crowding_distance(front,fitness_values):
    #定义列表
    num_objectives = len(fitness_values[0])
    values = []#[个体编号，TC，Seed]
    crowding_distances = [[0, 0.0] for i in front]#[个体编号，拥挤度]
    #print("初始化 crowding_distances", crowding_distances)
    #取出当前层中个体的目标值
    for i in front:#i为个体编号
        #print("i",i)
        values.append([i,fitness_values[i][0],fitness_values[i][1]])#初始化拥挤度为0
    #\print("初始化values",values)
    #计算拥挤距离
    for i in range(num_objectives):
        if i == 0:  # 第一个目标是最小化目标函数
            sorted_values = sorted(values, key=lambda x: x[i+1])
            #print('第一个目标升序排序sorted_values',sorted_values)
            #初始化列表
            for c in range(len(sorted_values)):
                crowding_distances[c][0] = sorted_values[c][0]
            #print("初始化crowding_distances",crowding_distances)
        else:  # 第二个目标是最大化目标函数，按递减的顺序进行排序
            sorted_values = sorted(values, key=lambda x: x[i+1] )#reverse=True
            #print('第二个目标降序排序sorted_values',sorted_values)
        crowding_distances[0][1] = crowding_distances[len(front)-1][1] = float('inf')
        #print("拥挤距离首尾赋值",crowding_distances)
        fitness_range = sorted_values[len(front)-1][i+1] - sorted_values[0][i+1]
        #print("fitness_range",fitness_range)
        if fitness_range == 0:
            continue
        for j in range(1, len(front)-1):
            crowding_distances[j][1] += (sorted_values[j+1][i+1] - sorted_values[j-1][i+1]) / fitness_range
    #print("最终crowding_distances",crowding_distances)
    return crowding_distances

#输入前沿层，目标值列表；输出整个种群的拥挤距离
def crowding_distance(frontset,objective):
    distance_list=[]
    #print('%%%%%%%%%%%%%%%%进入拥挤距离计算')
    #print('frontset',frontset)
    #print('objective',objective)
    for i in range(len(frontset)):#遍历每一个前沿层
        distance = front_crowding_distance(frontset[i],objective)
        distance_list.append(distance)
    #print('distance_list',distance_list)
    return distance_list  


#选择算子，输入种群，种群的frontNumber和crowdDistance[[第一层个体的拥挤度[个体编号，个体编码，拥挤度]],[]……]
def tournament(frontnumber,distance):
    # 个体索引列表
    index = list(range(len(frontnumber)))
    # 选择两个个体
    select = []
    for i in range(2):
        # 随机选择两个个体
        templist = random.choices(index, k=2)
        #print('tempList',tempList)
        # 选择更优的个体
        if frontnumber[templist[0]] < frontnumber[templist[1]]:
            select.append(templist[0])
        elif frontnumber[templist[1]] < frontnumber[templist[0]]:
            select.append(templist[1])
        else:  # 选择拥挤度较大的个体
            pop_distance = [p for layer in distance for p in layer]
            #print('pop_distance ',pop_distance )
            pop_distance.sort(key=lambda x: x[0])
            #print('排序后pop_distance ',pop_distance )
            select.append(max(templist, key=lambda x: pop_distance[x][1]))
    return select
