def crossover(pop1, pop2):
    copypop1 = copy.deepcopy(pop1)
    copypop2 = copy.deepcopy(pop2)
    # 随机选择两个交叉点
    index1 = np.random.randint(0, len(copypop1) - 1)
    index2 = np.random.randint(index1, len(copypop1))
    #print('index1',index1)
    #print('index2',index2)
    # 存储交叉点之间的代码
    code1 = copypop1[index1:index2+1]
    code2 = copypop2[index1:index2+1]
    # 交换两个交叉点之间的代码
    copypop1[index1:index2+1] = code2
    copypop2[index1:index2+1] = code1
    # 返回交叉后的两个个体
    newpops = []
    newpops.append(copypop1)
    newpops.append(copypop2)
    return newpops

def mutation(pop):
    copypop = copy.deepcopy(pop)
    randomselectseru = np.random.randint(1, len(pop)//2+1)#[1,6)之间的整数
    #print('randomselectseru',randomselectseru)
    index_skilllevel = 2 * randomselectseru - 1
    index_workers = index_skilllevel + 1
    new_skilllevel = np.random.randint(0,len(skilllevel_set)-1)
    #print('new_skilllevel',new_skilllevel)
    new_workers = np.random.randint(0, worker_maxnum + 1)
    #print('new_workers',new_workers)
    newpop = copypop[:]
    newpop[index_skilllevel] = new_skilllevel
    newpop[index_workers] = new_workers
    return newpop

#邻域搜索，在单元数不变的情况下，任意调整人数配置，包括全能工人数和单元内人数
#如果邻域比原个体好，就用邻域个体替换原个体
def off_neighbour(pop,neighbour_num):
    #print('pop',pop)
    #解码
    skill_level = decoding(pop) [1]
    index = [i for i in range(len(skill_level)+1)]#全能工+有效单元索引
    #index = [i for i in range(len(skill_level))]#有效单元索引
    #print('index',index)
    #将技能水平和工人数量分别取出（包括0也取出来）
    skill = pop[1::2]#将奇数位的技能水平取出来
    worker = pop[2::2]#将偶数位的工人数量取出来
    #print('skill',skill)
    #print('worker',worker)
    #搜索邻域
    neighbours = []
    neighbours_objective = []
    k=0
    while k < neighbour_num:#生成要求数量的邻域，一定都是可行解
        #print('#########新一次循环#########',pop)
        temp_pop=copy.deepcopy(pop)
        #从全能工和非全能工里面选要变化的人数，选择概率是相同的
        random_item = random.choice(index)#从全能工+有效单元中随机选择一项
        #print('random_item',random_item)
 
        if random_item == 0:#修改全技能工人数
            temp_pop[0] = random.randint(0,worker_maxnum)
            #print('调整全能工人数后的邻域个体',temp_pop)
        else:#选择的是单元
            #找到所选的单元在编码中的位置
            serunum = 0
            for i in range(len(skill)):
                #print('i',i)
                if (skill[i] != 0) and (worker[i] != 0):
                    #print("skill且worker都不为0")
                    serunum += 1
                    #print('serunum',serunum)
                else:
                    continue
                if serunum == random_item:#找到了选择的单元，对该单元人数进行调整
                    temp_pop[2*i+2] = random.randint(1,worker_maxnum)#注意不能为0，否则就改变单元数量了
                    #print('调整单元人数后的邻域个体',temp_pop)
                    break
                else:
                    continue

        #检查邻域个体是否和原个体相同
        if temp_pop == pop:
            #print("与原个体相同，进入下一循环")
            continue
        else:
            #print('邻域个体与原个体不相同')
            #计算邻域个体的目标值
            temppop_objective = [compute_trainingcost(temp_pop),averageTTPT(temp_pop,OrderList)] 
            #print('temppop_objective',temppop_objective)
            if temppop_objective not in neighbours_objective:#邻域个体不允许重复
                neighbours.append(temp_pop)
                neighbours_objective.append(temppop_objective)
                k += 1
        #print('neighbours',neighbours)   
        #print('neighbours_objective',neighbours_objective) 
    return neighbours,neighbours_objective

#输入：种群、非支配排序结果、拥挤距离和对应的两个目标值。这是为了减少计算。
#无需对种群进行非支配排序，非支配排序结果作为输入.
def get_offspring(population,frontnumber,distance):#输入父代，输出子代及子代目标值
    copy_population=copy.deepcopy(population)
    offspring = []
    offspring_objective = []
    while len(offspring) < len(copy_population):#产生子代
        #print('进入循环，子代个体数量len(offspring)',len(offspring))
        #选择算子，选择两个个体
        parentsIndex = tournament(frontnumber,distance)
        parents = [copy_population[i] for i in parentsIndex]
        #print('选择的个体parents',parents)
        #遗传算子：交叉和变异
        newpops = []#其中至少含有一个个体
        rc= random.random()#随机产生一个数
        #print('rc',rc)
        if (rc <= cross_rate):#发生交叉，产生两个新个体
            #print("发生交叉")
            newpops = crossover(parents[0], parents[1])#cp中有两个个体
            #print("newpops",newpops)
        else:#没有发生交叉，任意选择一个个体按照概率发生变异
            #print("没有发生交叉")
            #随机选择一个个体，按照概率发生变异
            random_num = random.randint(0, 1)#从0和1中随机选择一个数
            #print('random_num',random_num)
            pop = parents[random_num]
            #print('pop',pop)
            #随机产生一个数，判断是否发生变异
            rm = random.random()
            #print('rm',rm)
            if (rm <= mutation_rate):#发生变异
                newpops.append(mutation(pop))
                #print("发生变异", newpops)
            else:#没有发生变异
                newpops.append(pop)
                #print("没有发生变异",newpops)
        #修复策略：判断是否是可行解，如果不是可行解需要修复
        repairedpops = []
        for i in newpops:#遍历遗传后的个体
            #print('i',i)
            if is_feasible_solution(i) is True:
                repairedpops.append(i)
                #print('变异后代是可行解添加')
            else:#不是可行解则修复后添加
                #print("不是可行解",i)
                repair_pop = repair(i)
                repairedpops.append(repair_pop)
        #print('repairedpops',repairedpops)
        #去重，子代中已经有的个体不添加,注意：是个体目标值是否相同，不是个体是否相同
        pop_objective=[]
        for i in repairedpops:
            pop_objective = [compute_trainingcost(i),averageTTPT(i,OrderList)] 
            #print('pop_objective',pop_objective)
            if pop_objective not in offspring_objective:
                offspring.append(i)
                offspring_objective.append(pop_objective)
            else:
                continue
        #print('offspring',offspring)
        #print('offspring_objective',offspring_objective)
    offspring = offspring[:len(copy_population)]
    offspring_objective = offspring_objective[:len(copy_population)]
    #print('最终offspring',offspring)
    #print('最终offspring_objective',offspring_objective)
    return offspring,offspring_objective


#输入：子代种群 输出：邻域种群
def generate_neighbour(offspring,offspring_objective,neighbour_num,neighbour_front):
    copy_offspring = copy.deepcopy(offspring)
    copy_offspring_objective = copy.deepcopy(offspring_objective)
    #print('copy_offspring',copy_offspring)
    #对子代进行非支配排序
    offspring_frontset = nondominatesort(offspring_objective)[0]
    #print('对子代进行非支配排序offspring_frontset',offspring_frontset)
    #初始化邻域种群为子代的非支配解
    neighbour_pops = [copy_offspring[i] for i in offspring_frontset[0]]
    neighbour_objectives = [copy_offspring_objective[i] for i in offspring_frontset[0]]
    #print('初始化neighbour_pops',neighbour_pops)
    #print('初始化neighbour_objectives',neighbour_objectives)
    #从子代种群中选取前neighbour_front中的个体进行邻域搜索(选出好的个体进行邻域搜索)
    select_index = []
    for i in range(neighbour_front):
        #print('i',i)
        for j in offspring_frontset[i]:
            #print('j',j)
            select_index.append(j)
    #print('被选出参加邻域的个体select_index',select_index)
    select_pops = [copy_offspring[i] for i in select_index]
    #select_objective = [copy_offspring_objective[i] for i in select_index]
    #print('被选出参加邻域的种群select_objective',select_objective)
    #对选出的个体进行邻域搜索
    for i in range(len(select_pops)):
        #print('select_objective[i]',select_objective[i])
        tempop,temobjective = off_neighbour(select_pops[i],neighbour_num)
        #print('temobjective',temobjective)
        #遍历每个邻域个体，如果不被子代的非支配解支配，就加入邻域种群
        for p in range(len(tempop)):
            #print('当前个体temobjective[p]',temobjective[p])
            t = 0 #记录p不被支配的次数
            for q in range(len(neighbour_pops)):#与邻域种群中的个体比较看是否被支配
                #一旦遇到当前个体被邻域种群中的个体支配（q支配p），则不添加进邻域种群，退出循环，下一个p；
                if  (neighbour_objectives[q][0] <= temobjective[p][0] and neighbour_objectives[q][1] < temobjective[p][1]) or (neighbour_objectives[q][0] < temobjective[p][0] and neighbour_objectives[q][1] <= temobjective[p][1]):#q支配p
                    #print('被邻域种群支配：',neighbour_objectives[q])
                    break
                else:
                    t += 1
                    #print('不被邻域种群支配的次数',t)
            if t == len(neighbour_pops):#即P不被邻域种群中的任何一个个体支配，在添加进邻域种群
                neighbour_pops.append(tempop[p])
                neighbour_objectives.append(temobjective[p])
                #print('neighbour_objectives',neighbour_objectives)
            else:
                continue
            #print('neighbour_pops',neighbour_objectives)
    #print('neighbour_pops',neighbour_pops)
    #print('neighbour_objectives',neighbour_objectives)
    return neighbour_pops,neighbour_objectives

#三个种群合并，去除重复个体，重复个体是指两个目标值均相等的个体
#输出去重的合并种群，及其目标值
def combine_population(population1,objective1,population2,objective2,population3,objective3):#输入父代种群和子代种群，输出新种群
    copy_population1= copy.deepcopy(population1)
    copy_population2= copy.deepcopy(population2)
    copy_population3= copy.deepcopy(population3)
    copy_objective1= copy.deepcopy(objective1)
    copy_objective2= copy.deepcopy(objective2)
    copy_objective3= copy.deepcopy(objective3)
    #初始化合并种群为父代种群
    con_pops = copy_population1 
    con_objective = copy_objective1
    #print('con_pops',con_pops)
    #遍历子代种群的每个个体，将目标值不同的个体添加进合并种群
    for i in range(len(copy_population2)):
        #print('population2',population2)
        if  copy_objective2[i] not in con_objective:
            #print('不在父代种群中')
            con_pops.append(copy_population2[i])
            con_objective.append(copy_objective2[i])
        else:
            #print('在父代种群中')
            continue
    #遍历邻域种群，将将目标值不同的个体添加进合并种群    
    for l in range(len(copy_population3)):
        if copy_objective3[l] not in con_objective:
            #print('No邻域个体不在合并种群中')
            con_pops.append(copy_population3[l])
            con_objective.append(copy_objective3[l])
        else:
            #print('Yes邻域个体在合并种群中')
            continue
    #print('con_pops',con_pops)
    #print('con_objective',con_objective)
    return con_pops,con_objective

#输入一个种群、目标值及非支配排序，输出新种群及其目标值（不是按照从小到大排序的）
def produce_newpopulation(conpopulation,con_objective,frontset_index,popsize):#输入合并种群和种群规模，输出新父代种群
    #对合并种群的目标值列表进行深复制
    copy_objective=copy.deepcopy(con_objective)
    #定义列表
    newparents = []#新父种群
    newobjective = []#新父种群目标值列表
    number = 0 #记录front层
    while (len(newparents) < popsize):
        if ((len(newparents) + len(frontset_index[number])) <= popsize):
            #print("整层加入")
            for i in frontset_index[number]:#整层加入
                newparents.append(conpopulation[i])
                newobjective.append(copy_objective[i])
            number += 1
        else:
            #print("number",number)
            distance = front_crowding_distance(frontset_index[number],con_objective)#计算该层的拥挤距离
            #print('distance',distance)
            distance.sort(key= lambda x: x[1], reverse=True) #按照拥挤距离降序排序
            #print('拥挤距离降序排序distance',distance)
            parent_num = len(newparents)
            #print("加入该层部分个体")
            for i in range(popsize-parent_num):#新种群还差个体补齐
                newparents.append(conpopulation[distance[i][0]])
                newobjective.append(copy_objective[distance[i][0]])
            number += 1
    return newparents,newobjective

