def main():
    paretosolution_list=[]#记录每一代非支配解[[第一代非支配解],[]……]
    allsolutions=[]
    ##第一步：初始化种群
    solution = initial_population(population_size,seru_maxnum,worker_maxnum)
    print('初始种群',solution)
    ##第二步：计算种群中每个个体的目标值，进行非支配排序（计算非支配排名）
    objective = objectivevalue_set(solution,OrderList)
    print('初始objective',objective)
    #对种群内的个体进行非支配排序，得到非支配解
    front_set,front_number = nondominatesort(objective)
    print('front_set',front_set)
    print('front_number',front_number)
            
    pareto_solution = []
    pareto_pop = []
    for i in front_set[0]:
        pareto_solution.append(objective[i])
        pareto_pop.append(solution[i])
    print('#######排序前的帕累托解pareto_solution',pareto_solution)
    print('#######pareto_pop',pareto_pop)
    pareto_solution.sort(key= lambda x: x[1])#按照TTPT升序排序

    ##第三步：计算拥挤距离
    distance = crowding_distance(front_set,objective)
    parents = solution
    parents_objective = objective
    iterator = 0
    while iterator < maxIterator:#解保持不变的代数
        print('##########进入循环#################',iterator)
        #产生子代及其目标值，子代中没有重复个体
        offspring,offspring_objective =  get_offspring(parents,front_set,distance)
        print('offspring',offspring)
        print('offspring_objective',offspring_objective)
        #产生offspring的局部搜索种群
        neibour_population,neibour_objective = generate_neighbour(offspring,offspring_objective,neighbour_num,neighbour_front)
        print('邻域搜索种群neibour_population',neibour_population)
        print('邻域搜索种群neibour_objective',neibour_objective)
        #合并父代+子代+邻域种群，去除重复个体
        con_population,con_objective = combine_population(parents,parents_objective,offspring,offspring_objective,neibour_population,neibour_objective)
        print('con_population',con_population)
        print('con_objective',con_objective)
        #对合并种群进行非支配排序
        con_frontset,con_frontnumber = nondominatesort(con_objective)
        print('con_frontset',con_frontset)
        print('con_frontnumber',con_frontnumber)    
        #产生新父种群及其目标值
        new_parents,new_objective = produce_newpopulation(con_population,con_objective,con_frontset,population_size)
        print('new_parents',new_parents)
        print('new_objective',new_objective)
        #对新种群进行非支配排序，得到非支配解
        new_frontset,new_frontnumber = nondominatesort(new_objective)
        print('new_frontset',new_frontset)
        #print('new_frontnumber',new_frontnumber)
        #更新所有可行解集
        for f in range(len(new_objective)):
            allsolutions.append(new_objective[f])
        #print('##########allsolutions',allsolutions) 
        new_pareto_solution = []
        new_pareto_pop = []
        for i in new_frontset[0]:
            new_pareto_pop.append(new_parents[i])
            new_pareto_solution.append(new_objective[i])
        print('######################new_pareto_pop',new_pareto_pop)
        print('@@@@@@@@@@@@@@@@@@@@@@排序前的帕累托解',new_pareto_solution)    
        #按照TTPT升序排序
        new_pareto_solution.sort(key= lambda x: x[1])
        #print('##########按照TTPT升序排序后new_pareto_solution',new_pareto_solution)
        #计算拥挤距离
        new_distance = crowding_distance(new_frontset,new_objective)
        #将每代pareto解存放起来
        paretosolution_list.append(new_pareto_solution)
        #print('##########paretosolution_list',paretosolution_list) 
                
        parents = new_parents 
        parents_objective = new_objective
        front_set = new_frontset
        front_number = new_frontnumber
        distance = new_distance
        iterator += 1
    #最终帕累托解
    print('@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@退出循环############################')
    print('@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@new_pareto_pop',new_pareto_pop)
    print('@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@排序后new_pareto_solution',new_pareto_solution)
    print('@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@allsolutions',allsolutions)
    print('@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@paretosolution_list', paretosolution_list)
    print('#allsolutions',len(allsolutions))
    print('len(new_pareto_pop)',len(new_pareto_pop))
    print('len(skilllevel_set)',len(skilllevel_set))

    t=0
    for ff in new_pareto_pop:
        print(ff)
        if is_feasible_solution(ff) is True:
            t += 1
        else:
            print("不可行解",ff)
    print("可行解数量",t)
    
    return paretosolution_list,new_pareto_solution

     
